const TodoList = _=>{
    let todo = [
        'element 1',
        'element 2',
        'element 3',
        'element 4',
    ];

    return (
        <div>
            <ul>
                {todo.map((todoElement, index) => (
                    <li key={todoElement}>
                        {todoElement} {todoElement}
                    </li>
                ))}
            </ul>
        </div>
    );
}
export default TodoList
